import React, {Component, createRef} from 'react';
import {base} from '../firebase/firebase';
import { Card, Icon } from 'antd';
import ContentEditable from 'react-contenteditable'

  class Intents extends Component {
    render() {
        return  (
            <>{this.props.userInfo?
                <div 
                    id="products" 
                    style={{width: '100%', padding: "25px"}} 
                >        
                    <Card
                        style={{margin: '2px'}} 
                        title={
                            <span style={{color:'rgb(0, 75, 222)'}}>
                                Intents
                            </span>
                        }
                        extra={
                            <Icon 
                                style={{color: 'green'}}
                                type="edit" 
                                key="edit" 
                            />
                        }
                    >

                        <div style={{float: 'center'}} className='row'>
                            <div className='col-lg-6 col-md-12 col-sm-12'>{
                                <ul className="list-group">{
                                    Object.keys(this.props.userInfo.intents).map(
                                        item=> <li className="list-group-item">{this.props.userInfo.intents[item].name}</li>
                                    )
                                }</ul>
                            }   
                            </div>

                            <div className='col-lg-6 col-md-12 col-sm-12'></div>
                        </div>
                    </Card>
                </div>
                :''
            }</>
        )
    }
}


export default Intents
